Opening

Alex continues his series on the Tenth Amendment and states' rights by welcoming Rep. Dan Itse of New Hampshire to the program. Itse supports House Concurrent Resolution 6 calling for states' rights &quot;based on Jeffersonian principles.&quot; Alex also talks with Rep. Paul Ingbretson about the New Hampshire resolution. Additional guests inlude Bob Chapman of the International Forecaster and former Austin city council representative, businessman, author, and documentary film maker George Humphrey. 

